// src/components/UIComponents/DiagramEditor.js
import React from "react";
import { Box } from "@mui/material";
import Sidebar from "./Sidebar";
import CanvasArea from "./CanvasArea";

/**
 * DiagramEditor Component
 * -------------------------------------
 * This component composes the Sidebar and the CanvasArea.
 * It is the main layout for the diagram editor screen.
 */

const DiagramEditor = ({ darkMode, setDarkMode }) => {
  // The darkMode props here are not currently used by CanvasArea or Sidebar directly.
  // If you want to propagate the external darkMode state, pass it down or use a context.
  return (
    <Box sx={{ display: "flex", width: "100%", height: "100vh" }}>
      <Sidebar />
      <CanvasArea />
    </Box>
  );
};

export default DiagramEditor;
